('us', '\r\n#include <bits/stdc++.h>\r\nusing namespace std;\r\nint main()\r\n{\r\n    deque<int>dq;\r\n    int t,n,m,i,j,p,r,c;\r\n    string s;\r\n    cin>>t;\r\n    for(i=1;i<=t;i++)\r\n    {\r\n        c=1;\r\n        cin>>n>>m;\r\n        dq.clear();  //make dequeue empty\r\n        printf("Case %d:\n",i);\r\n        for(j=1;j<=m;j++)\r\n        {\r\n            cin>>s;\r\n\r\n\r\n            if(dq.size()==n && (s=="pushLeft" || s=="pushRight"))\r\n            {\r\n                cout<<"The queue is full"<<endl;\r\n                j--; //decrease value of j as dequeue is full\r\n            }\r\n            else if(s=="pushLeft" && !(dq.size()==n))\r\n            {\r\n                cin>>p;\r\n                dq.push_front(p);\r\n                printf("Pushed in left: %d\n",p);\r\n            }\r\n            else if(s=="pushRight" && !(dq.size()==n))\r\n            {\r\n                cin>>p;\r\n                dq.push_back(p);\r\n                printf("Pushed in right: %d\n",p);\r\n            }\r\n            else if(s=="popLeft" && !(dq.empty()))\r\n            {\r\n\r\n                printf("Popped from left: %d\n",dq.front());\r\n                dq.pop_front();\r\n            }\r\n            else if(s=="popRight" && !dq.empty())\r\n            {\r\n                  printf("Popped from right: %d\n",dq.back());\r\n                  dq.pop_back();\r\n            }\r\n            else if(dq.empty())\r\n            {\r\n                printf("The queue is empty\n");\r\n            }\r\n        }\r\n\r\n    }\r\n    return 0;\r\n}\r\n', 36),
