('shawon', '\r\n#include <bits/stdc++.h>\r\nusing namespace std;\r\n\r\n\r\nstruct point\r\n{\r\n    string x[200];\r\n    double y;\r\n};\r\n\r\n\r\nint main()\r\n{\r\n    struct point a[200],b[200],tmp;\r\n    int i,j,n,c,k;\r\n    string st,ct[200];\r\n    double cg;\r\n    cin>>n;\r\n    for(i=0;i<n;i++)\r\n    {\r\n        cin>>a[i].x[i]>>a[i].y;\r\n\r\n\r\n    }\r\n\r\n    //sort according to cgpa\r\n    for(i=0;i<n;i++)\r\n    {\r\n        for(j=i+1;j<n;j++)\r\n        {\r\n            if(a[i].y<a[j].y)\r\n            {\r\n                swap(a[i].x[i],a[j].x[j]);\r\n                swap(a[i].y,a[j].y);\r\n            }\r\n        }\r\n    }\r\n    //sort name when cgpa  same\r\n\r\n   for(i=0;i<n;i++)\r\n    {\r\n        for(j=i+1;j<n;j++)\r\n        {\r\n\r\n            if(a[i].y==a[j].y)\r\n            {\r\n\r\n               if(a[i].x[i]>a[j].x[j])\r\n               {\r\n\r\n                   st=a[i].x[i];\r\n                   a[i].x[i]=a[j].x[j];\r\n                   a[j].x[j]=st;\r\n               }\r\n\r\n\r\n            }\r\n\r\n        }\r\n    }\r\n\r\n    cg=0.0;\r\n    c=0;\r\n    for(i=0;i<n;i++)\r\n    {\r\n\r\n       if(a[i].y>cg || a[i].y<cg)\r\n       {\r\n           c++;\r\n       }\r\n       cg=a[i].y;\r\n       cout<<c<<"."<<a[i].x[i]<<endl;\r\n\r\n\r\n    }\r\n\r\n    return 0;\r\n\r\n}', 190);
