('shawon', '#include <bits/stdc++.h>\r\nusing namespace std;\r\nbool compare( const pair<string,long long int>& x, const pair<string, long long int>& y )\r\n{\r\n\r\n    return (x.second>y.second); //descending\r\n\r\n}\r\nint main()\r\n{\r\n    long long int t,n,i,j,k,m;\r\n    string s;\r\n    vector<pair<string,long long int> >a;\r\n    //freopen("12015.txt","r",stdin);\r\n    //freopen("12015out.txt","w",stdout);\r\n    cin>>t;\r\n    for(i=1;i<=t;i++)\r\n    {\r\n        m=0;\r\n        a.clear();\r\n        for(j=1;j<=10;j++)\r\n        {\r\n            cin>>s>>n;\r\n            if(m<n)\r\n            {\r\n                m=n;\r\n            }\r\n            a.push_back(make_pair(s,n));\r\n        }\r\n        stable_sort(a.begin(),a.end(),compare);\r\n        vector<pair<string,long long int> >::iterator p;\r\n        printf("Case #%lld:\n",i);\r\n        for(p=a.begin();p!=a.end();p++)\r\n        {\r\n           if(m==p->second)\r\n           {\r\n               cout<<p->first<<endl;\r\n           }\r\n        }\r\n\r\n\r\n    }\r\n    return 0;\r\n\r\n\r\n\r\n\r\n}', 193),
('shawon', '#include <bits/stdc++.h>\r\nusing namespace std;\r\nclass result\r\n{\r\n    string x;\r\n    double y;\r\npublic:\r\n    int get(result a[1000]);\r\n};\r\n\r\nint result::get(result a[1000])\r\n{\r\n    int i,j,n;\r\n    cin>>n;\r\n    for(i=0;i<n;i++)\r\n    {\r\n        cin>>a[i].x>>a[i].y;\r\n\r\n    }\r\n    for(i=0;i<n;i++)\r\n    {\r\n        for(j=i+1;j<n;j++)\r\n        {\r\n            if(a[i].y<a[j].y)\r\n            {\r\n                swap(a[i].x,a[j].x);\r\n                swap(a[i].y,a[j].y);\r\n            }\r\n        }\r\n    }\r\n    //sort name\r\n    for(i=0;i<n;i++)\r\n    {\r\n        for(j=i+1;j<n;j++)\r\n        {\r\n            if(a[i].y==a[j].y)\r\n            {\r\n                if(a[i].x>a[j].x)\r\n                {\r\n                    swap(a[i].x,a[j].x);\r\n                }\r\n\r\n            }\r\n        }\r\n    }\r\n    double cg=0.0;\r\n    int c=0;\r\n    for(i=0;i<n;i++)\r\n    {\r\n\r\n       if(a[i].y>cg || a[i].y<cg)\r\n       {\r\n           c++;\r\n       }\r\n       cg=a[i].y;\r\n       cout<<c<<"."<<a[i].x<<endl;\r\n\r\n\r\n    }\r\n\r\n}\r\n\r\nint main()\r\n{\r\n    result a[1000],ob;\r\n    ob.get(a);\r\n\r\n\r\n\r\n}', 194),
